import React from "react";
import girl from "./assets/girl.png"
import star from "./assets/star.png"

export default function Card(props){
    return(
        <section className="Card">
            <img className = "cover" src={props.img} alt ="girl"></img>
            <h4> <span><img src = {star} alt = "star"></img></span>5.0 <span className="who">(6) . USA</span></h4>
            <p>Life lessons with Katie Zaferes</p>
            <h3 className="cost">From $136 <span>/ person</span></h3>
        </section>
    )
}
